export interface CustomChannelOptions {
  index: number;
  mute: boolean;
  volume: number;
  decibel: number;
}
export interface ChannelOptions {
  overlay?: boolean;
  colors?: string[];
  relativeNormalization?: boolean;
  filterChannels?: number[];

}

export interface Channel {
  label: string;
  color: string;
  disabled?: boolean;
}

export const colors = ['#A1A1A1', '#A553AB', '#B5B260', '#68BC00', '#B16245', '#368D5F'];

export interface Region {
  id: string;
  channelIndex: number;
  start: number;
  end: number;
  editable: boolean;
  color: string;
  text?: string;
  audition?: boolean;
}

export enum SelectBorder {
  LEFT = 'left',
  RIGHT = 'right',
}

export enum SegmentMode {
  CONTINUOUS = 'continuous',
  INDIVIDUAL = 'individual',
}

export enum OverlapMode {
  OVERLAP = 'overlap',
  DISABLED_OVERALL_OVERLAP = 'disabled_overall_overlap',
  DISABLED_CHANNEL_OVERLAP = 'disabled_channel_overlap',
}
